import React from 'react'
import Navbar from '../pages/LandingPage'


class PageTwo extends React.Component {
    state = {
        animals: []

    }

    componentDidMount() {
        fetch('/api/animals')
            .then(response => response.json())
            .then(data => this.setState({ animals: data }))
    }
    render() {
        let dogs = this.state.animals.filter(animal => {
            return animal.species === 'Dog' && animal.photo
        })
        console.log(dogs)
        let animals = dogs.map((animals, key) =>
            <div key={animals.name}>
                <img src={animals.photo} alt="dogs" />
                {animals.name}
            </div>
        )

        return (
            <div className="pets">
                {this.animals}
            </div >
        )
    }
}
export default PageTwo
